settings.markerImageFunction:
var state = dsData[dsIndex]['state'];
if (state == "false") {
	var res = {
	    url: images[0],
	    size: 30
	}
	return res;
} else if (state == "true") {
	var res = {
	    url: images[1],
	    size: 30
	}
	return res;
}

settings.labelFunction:
var deviceType = dsData[dsIndex]['deviceType'];
if (typeof deviceType !== undefined) {
    if (deviceType == "energy meter") {
        return '<span style="color:orange;">${entityName}, ${energy:2} kWt</span>';
    } else if (deviceType == "thermometer") {
        return '<span style="color:blue;">${entityName}, ${temperature:2} °C</span>';
    }
}

settings.tooltipFunction:
var deviceType = dsData[dsIndex]['type'];

var tooltip = '<b>${friendlyName}</b><br/>${entityName}<br/>';
var typeTooltip = '';

if (deviceType == "smart-sensor") {
    typeTooltip = '<br/><span style="font-weight: 500; color:#666;">Sıcaklık:</span>&nbsp;<span style="color:#f44336; font-weight: 600;">${temperature:1} °C</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Nem:</span>&nbsp;<span style="color:#1e88e5; font-weight: 600;">${humidity:1} %</span><br/>';
    typeTooltip += '<br/><b>Air quality</b><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">CO2 Seviyesi:</span>&nbsp;<span style="color:#9f4295; font-weight: 600;">${co2:0} ppm</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">TVOC Seviyesi:</span>&nbsp;<span style="color:#3d9d9a; font-weight: 600;">${tvoc:3} ppm</span><br/>';
    typeTooltip += '<br/><span style="font-weight: 500; color:#666;">Doluluk:</span>&nbsp;<span style="color:#00897b; font-weight: 600;">${occupancyText}</span><br/>';
    typeTooltip += '<br/><link-act name="smart_sensor">Akıllı sensör detayları</link-act><br/></div>';
} else if (deviceType == "energy-meter") {
    typeTooltip = '<br/><span style="font-weight: 500; color:#666;">Enerji tüketimi:</span>&nbsp;<span style="color:#673ab7; font-weight: 600;">${energy:4} kWh</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Güç tüketimi:</span>&nbsp;<span style="color:rgb(30, 136, 229); font-weight: 600;">${power:0} W</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Akım (Amper):</span>&nbsp;<span style="color:#f44336; font-weight: 600;">${amperage:2} A</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Gerilim:</span>&nbsp;<span style="color:#2196f3; font-weight: 600;">${voltage:2} V</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Frekans:</span>&nbsp;<span style="color:rgb(104, 159, 56); font-weight: 600;">${frequency:2} Hz</span><br/>';
    typeTooltip += '<br/><link-act name="energy_meter">Enerji analizörü detayları</link-act><br/></div>';
} else if (deviceType == "water-meter") {
    typeTooltip = '<br/><span style="font-weight: 500; color:#666;">Su tüketimi:</span>&nbsp;<span style="color:#01579b; font-weight: 600;">${water:3} gal</span><br/>';
    typeTooltip += '<br/><link-act name="water_meter">Su sayacı detayları</link-act><br/></div>';
} else if (deviceType == "hvac") {
    typeTooltip = '<br/><span style="font-weight: 500; color:#666;">Durum:</span>&nbsp;<span style="color:${enabledTextColor}; font-weight: 600;">${enabledText}</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Hedef sıcaklık:</span>&nbsp;<span style="color:#4caf50; font-weight: 600;">${targetTemperature:1} °C</span><br/>';
    typeTooltip += '<span style="font-weight: 500; color:#666;">Hava akışı:</span>&nbsp;<span style="color:#2196f3; font-weight: 600;">${airFlow:1} cfm</span><br/>';
    typeTooltip += '<br/><link-act name="hvac">HVAC detayları</link-act><br/></div>';
}

return tooltip + typeTooltip;

settings.polygonColorFunction:
var state = dsData[dsIndex]['state'];
if (state == "false") {
	return "red";
} else if (state == "true") {
	return "green";
}

settings.cardCss:
.card,
.card * {
    width: 100%;
    height: 100%;

}    
.card {
    min-width: 90%;
    height: 90%;
}
.card .content {
    width: 100%;
    margin: 0;
    height: 70%;
    color: #757575;
    position: relative;
    top: 50%;
    transform: translateY(-50%);

}

h1 {
    font-weight: 600;
    font-size: 2.7vh;
    text-align: center;
    margin: auto;

}

settings.pointShapeFormatter:
var size = radius * Math.sqrt(Math.PI) / 2;
ctx.moveTo(x - size, y - size);
ctx.lineTo(x + size, y + size);
ctx.moveTo(x - size, y + size);
ctx.lineTo(x + size, y - size);

var size = radius * Math.sqrt(Math.PI) / 2;
ctx.moveTo(x - size, y - size);
ctx.lineTo(x + size, y + size);
ctx.moveTo(x - size, y + size);
ctx.lineTo(x + size, y - size);
